By default all emergent decision makers are designed to be used in hierarchies so building HFSM is really simple - you just put one Machinery as a state in another. What's new comparing to the flat Machinery setup is we have to assign initial state decision maker that whenever Machinery gets activated, it will activate some starting state for that Machinery. # extern crate emergent;
# use emergent::prelude::*;
# use std::hash::Hash;
#
# #[derive(Debug, Copy, Clone, PartialEq, Eq)]
# enum Target {
# None,
# Found,
# Reached,
# }
#
# #[derive(Debug, Copy, Clone, Hash, PartialEq, Eq)]
# enum EnemyState {
# Patrol,
# Combat,
# FindWaypoint,
# WalkTowardsWaypoint,
# WalkTowardsPlayer,
# AttackPlayer,
# }
#
# struct EnemyData {
# waypoint: Target,
# player: Target,
# }
#
# struct Enemy {
# data: EnemyData,
# machinery: Machinery<EnemyData, EnemyState>,
# }
#
