Dummy way of implementing FSM works like this: There is a State trait that will be implemented for all states. This state has update method with context to read from / write to and it returns optional state ID. We do this bc we want states to do their work and that state might tells FSM to change into new state after FSM updates this state. # use std::{collections::HashMap, hash::Hash};
#
trait State<K, T> { // FSM runs this method only on curently active state, and after the update it // tries to change active state to whatever state ID we return here (None means // no change expected). fn update(&mut self, context: &mut T) -> Option<K>;
} struct FSM<K, T> { states: HashMap<K, Box<dyn State<K, T>>>, active_state: K,
} impl<K: Hash + Eq, T> FSM<K, T> { fn new(active_state: K) -> Self { Self { states: Default::default(), active_state, } } fn state<S: State<K, T> + 'static>(mut self, id: K, state: S) -> Self { self.states.insert(id, Box::new(state)); self } fn set_active_state(&mut self, id: K) { if self.states.contains_key(&id) { self.active_state = id; } } fn update(&mut self, context: &mut T) { if let Some(state) = self.states.get_mut(&self.active_state) { if let Some(id) = state.update(context) { self.set_active_state(id); } } }
} This might looks like the solution used in First steps but with extra steps in form of states as trait objects. Yes, you're right, so what's the goal of that? The goal is that with this approach we are able to "easly" iterate on states, quickly add new ones or remove ones we do not need anymore and all that FSM setup stay in one place and we have almost completely decoupled states one from another. Why did i said "almost completely decoupled"? Well, we still have hardcoded states IDs of transitions in state logic, that's not ok, we will fix that when we will do the better way of implementing FSM later, for now let's see how do we use FSM system we have created. Let's start with implementing enemy states: # trait State<K, T> {
