Our goal is to decouple states from one another completely, to do that we have to find out how states are coupled right now - let's take a look at some state logic: # trait State<K, T> {
# fn update(&mut self, context: &mut T) -> Option<K>;
# }
#
# #[derive(Debug, PartialEq, Eq)]
# enum Direction {
# Up,
# Down,
# Left,
# Right,
