# impl Direction {
# fn horizontal(&self) -> isize {
# match self {
# Self::Left => -1,
# Self::Right => 1,
# _ => 0,
# }
# }
#
# fn vertical(&self) -> isize {
# match self {
# Self::Up => -1,
# Self::Down => 1,
# _ => 0,
# }
# }
#
# fn next(&self) -> Self {
# match self {
# Self::Up => Self::Right,
# Self::Down => Self::Left,
# Self::Left => Self::Up,
# Self::Right => Self::Down,
# }
# }
# }
#
# #[derive(Debug, Hash, PartialEq, Eq)]
# enum EnemyState {
# Wait,
# Move,
# ChangeDirection,
# }
#
# struct EnemyData {
# position: (isize, isize),
# direction: Direction,
# }
#
struct EnemyMoveState(pub usize); impl State<EnemyState, EnemyData> for EnemyMoveState { fn update(&mut self, context: &mut EnemyData) -> Option<EnemyState> { if self.0 > 0 { self.0 -= 1; context.position.0 += context.direction.horizontal(); context.position.1 += context.direction.vertical(); None } else { Some(EnemyState::Wait) } }
} You can see that state update method contains conditions that tell if we should change into new state and state logic itself (enemy movement). What we can do with it is we can abstract conditions and state changes into separate code units and let states only perform their actual logic on update, also we add a state method to be called when state gets activated so it can setup context for that state updates: type Condition<T> = fn(&T) -> bool; trait State<T> { fn activated(&mut self, context: &mut T) {} fn update(&mut self, context: &mut T) {}
} Since we did that we also have to introduce new FSM transition and state types. FSM state will now hold the actual state object and list of all possible transitions, it will also be able to decide if FSM should change into new state by testing each transition condition and first one that passes, its state ID gets returned and FSM will then activate that state: # type Condition<T> = fn(&T) -> bool;
#
# trait State<T> {
# fn activated(&mut self, context: &mut T) {}
# fn update(&mut self, context: &mut T) {}
# }
#
struct FSMTransition<K, T> { to: K, condition: Condition<T>,
} struct FSMState<K, T> { state: Box<dyn State<T>>, transitions: Vec<FSMTransition<K, T>>,
} impl<K, T> FSMState<K, T> { fn new<S: State<T> + 'static>(state: S) -> Self { Self { state: Box::new(state), transitions: vec![], } } fn transition(mut self, to: K, condition: Condition<T>) -> Self { self.transitions.push(FSMTransition {to, condition}); self } fn decide(&self, context: &T) -> Option<K> where K: Clone { for transition in &self.transitions { if (transition.condition)(context) { return Some(transition.to.clone()); } } None }
} Now what's left is to adapt FSM to work with new states and transitions: # use std::{collections::HashMap, hash::Hash};
