struct FSM<K, T> { states: HashMap<K, FSMState<K, T>>, active_state: K,
} impl<K: Hash + Eq, T> FSM<K, T> { fn new(active_state: K) -> Self { Self { states: Default::default(), active_state, } } fn state(mut self, id: K, state: FSMState<K, T>) -> Self { self.states.insert(id, state); self } fn set_active_state(&mut self, id: K, context: &mut T) { if let Some(state) = self.states.get_mut(&id) { state.state.activated(context); self.active_state = id; } } fn decide(&mut self, context: &mut T) where K: Clone { if let Some(state) = self.states.get(&self.active_state) { if let Some(id) = state.decide(context) { self.set_active_state(id, context); } } } fn update(&mut self, context: &mut T) { if let Some(state) = self.states.get_mut(&self.active_state) { state.state.update(context); } }
} We have separated previous version of update method into two methods, one for deciding on what state FSM should change into, and another to actually update active state. We could still keep them together but it's good to make methods do only the job they describe - that will allow user to for example run decision making at lower frequency than the states update (for the sake of this tutorial we will call them together in enemy tick method just for the sake of smplification). When it comes to the enemy code itself, not much have changed except FSM setup and enemy data type: # use std::{collections::HashMap, hash::Hash};
